import React from "react";
const Button = () => {
  const btn = {
    width: "250px",
    height: "30px",
    textAlign: "center",
    backgroundColor: "lightyellow",
  };
  return (
    <>
      <button style={btn}>Login</button>
    </>
  );
};
export default Button;
